const requestsReducer = (state, action) => {
    const { type, payload } = action;

    if (type === "ADD_MEDICINE_REQUEST") {
        console.log("ADD_REQUEST");
        console.log("PAYLOAD ------------------------");
        console.log(payload.request);
        // return { ...state, medicineRequests: payload.products };
    }

    return state;
};

const RequestsContext = createContext({
    medicineRequests: [],
});

export const RequestsContextProvider = props => {
    const [state, dispatch] = useReducer(requestsReducer, {
        medicineRequests: [],
    });

    const addNewMedicinesRequest = request => {
        dispatch({ type: "ADD_MEDICINE_REQUEST", payload: { request } });
    };

    const contextValue = {
        medicineRequests: state.medicineRequests,
        addNewMedicinesRequest,
    };

    return (
        <RequestsContext.Provider value={contextValue}>{props.children}</RequestsContext.Provider>
    );
};

export const useRequestContext = () => useContext(RequestsContext);
